const imgArr = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQI690uavq_hS0h3wAUEZx4BrhoNriTyClfIA&usqp=CAU",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSdw8mq_yf0MVJafom4hH-6I0qef8fbeWEziw&usqp=CAU"
];

const StyledLeagueInfoPage = styled.div`
  border: 3px solid blue;
  margin: 10px 0 0 0;
  height: calc(100% - 13px);
`;

const StyledWrapper = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px;
  margin: 0px auto 0 auto;
  width: max-content;
  /* border: 10px solid red; */
  position: relative;
`;

const StyledImagesWrapper = styled.div`
  position: relative;
  display: flex;
  flex-direction: row;
  align-items: start;
  justify-content: center;
  transform-style: preserve-3d;
  perspective: 1000px;
`;

interface IImage {
  n: number;
  rotateN: number;
  currSelected: number;
  total: number;
}

const StyledImageWrapper = styled.div<IImage>`
  /* box-sizing: border-box; */
  display: flex;
  width: 150px;
  height: 150px;
  position: absolute;
  transition:
    scale 0.5s ease-in-out,
    margin-bottom 0.5s ease-in-out,
    transform 1s ease-in-out;
  transform: rotateY(
      calc(${(props) => props.n + props.rotateN} * ${(props) => Math.floor(360 / props.total)}deg)
    )
    translateZ(20vw);
  &:hover {
    scale: ${(props) => (props.n === props.currSelected ? 1.1 : 1)};
    margin-bottom: ${(props) => (props.n === props.currSelected ? 15 : 0)}px;
  }
`;

const StyledImage = styled.img`
  width: 100%;
  height: 100%;
`;

export default function LeagueInfoPage() {
  const [imagesArray] = useState(imgArr);
  const [rotateN, setRotateN] = useState(0);
  const [currSelected, setCurrSelected] = useState(0);
  // const params = useParams();
  // const { data, isLoading, isError } = useGetLeagueInfoByIdQuery(params.leagueId as string);

  // console.log("LeagueInfoPage: ", data);

  const handleNext = () => {
    setRotateN((prev) => prev + 1);
    setCurrSelected((prev) => {
      if (prev === 0) {
        return imagesArray.length - 1;
      } else {
        return prev - 1;
      }
    });
  };
  const handlePrev = () => {
    setRotateN((prev) => prev - 1);
    setCurrSelected((prev) => {
      if (prev === imagesArray.length - 1) {
        return 0;
      } else {
        return prev + 1;
      }
    });
  };

  return (
    <StyledLeagueInfoPage>
      <h1>League Info Page</h1>
      <div>
        <StyledWrapper>
          <div
            onClick={handlePrev}
            style={{
              position: "absolute",
              bottom: "calc(100% + 30px)",
              right: "calc(100% + 20vw)"
            }}
          >
            prev
          </div>
          <div
            onClick={handleNext}
            style={{ position: "absolute", bottom: "calc(100% + 30px)", left: "calc(100% + 20vw)" }}
          >
            next
          </div>
          <StyledImagesWrapper>
            {imagesArray.map((img, i, arr) => (
              <StyledImageWrapper
                total={arr.length}
                n={i}
                currSelected={currSelected}
                rotateN={rotateN}
              >
                <StyledImage src={img} alt="image" />
              </StyledImageWrapper>
            ))}
          </StyledImagesWrapper>
        </StyledWrapper>
      </div>
      {/* <pre>{JSON.stringify(data, null, 2)}</pre> */}
    </StyledLeagueInfoPage>
  );
}
